import "./css/App.css";
import namesData from "./data/namesData.json";

function App() {
  console.log(namesData);
  return (
    <div className="App">
      <header className="App-header">
        <div>
          {namesData.sort.map((nameObject) => {
            return <div>{nameObject.name}</div>;
          })}
        </div>
      </header>
    </div>
  );
}

export default App;
